import axios from "../Dall/axios-instance";

export const profileService = {
    getProfileInformation: (userId) => {
        let promise = axios.get(`profile/${userId}`).then(result => {
            return result.data
        })
        return promise
    },
    editNewProfileData: (newData) => {
        let promise = axios.post
    }
}
